import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const cards = [];
	const defaultPhotos = images.map((img, i) => {
		if (images[i].defaultPic) {
			return defaultPhotos.push(images[i]);
		}
	});

	defaultPhotos.map((photo, i) => {
		pets.map((pet, j) => {
			if(defaultPhotos[i].pets_id === pets[j].id) {
				return cards.push(<Card key={pets[j].id} img={'http://localhost:4412/api/file/' + defaultPhotos[i].url} name={pets[j].name} description={pets[j].description}/>);
			}
		});
	});

	return(
		<div>{cards}</div>
	)
}

export default CardList;

